(1, 'About Us', NULL, '<p>Welcome to AMBIT10N Academy, the premier soccer and futsal community in Dhaka, Bangladesh. Founded by Sanjay Karim, AMBIT10N is committed to nurturing and developing talent in every aspect of the beautiful game, combining expert coaching with holistic training methods, strong family values, and deep-rooted discipline.<br>Our comprehensive training caters to players of all skill levels, including personalized sessions that emphasize technical skills and game intelligence. Led by highly experienced and deeply passionate players and coaches, including Omar Sise, Diego Rojas, Nikola Vitorovic &amp; Sanjay Karim, we foster a community and create an environment where players thrive, both in competitive play and personal development.<br>At AMBIT10N, we know that soccer and futsal are more than just sportsâ€”they are pathways to personal growth and success in other walks of life. With fundamental training and mastery, along with the blessings of a supportive community, we are committed to guiding each player on their journey to achieving their dreams and becoming their best self.</p><p><br></p><p><img style=\"width: 50%; float: right;\" src=\"data:image/jpeg;base64,\" data-filename=\"1766829893_694faf450834e.jpeg\" class=\"note-float-right\">Join us, and unleash your best self.<br><br>The AMBIT10N Difference<br>Unlike many traditional clubs, which often become saturated and system-focused, prioritizing structure over individual growth, AMBIT10N is committed to developing the player, not just the team.<br>ðŸ”¹ Smaller Training Groups, Bigger Impact â€“ With lower player-to-coach ratios, every athlete receives personalized attention, ensuring they are more than just a number on a roster.<br>ðŸ”¹ Individual Growth Over System Fit â€“ While many clubs emphasize rigid systems and formations, we prioritize developing adaptable, intelligent, and creative players who can excel in any environment.<br>ðŸ”¹ More Coaches, More Mentorship â€“ Our elite coaching staff consists of many young professional footballers, giving players first-hand insight into what it takes to succeed at the next level.<br>Comprehensive Development<br>Our player development model goes beyond just training sessions:<br>â€‹<br>âš½ Elite Soccer &amp; Futsal Training â€“ The highest level of instruction in the country, focused on refining technical ability, game intelligence, and creativity.<br>ðŸ“š Classroom Sessions â€“ In-depth tactical analysis, film study, and sports psychology to develop smarter, more well-rounded athletes.<br>ðŸ’ª A Culture of Excellence â€“ A training environment that builds confidence, resilience, and a deep love for the game.<br>ðŸŒ Pathway to Pro<br>At AMBIT10N Academy, we donâ€™t just build teamsâ€”we build players, equipping them with the skills, mindset, and work ethic to compete at the highest level and pursue their greatest dreams.<br>Train. Learn. Compete. Succeed.</p><p><br></p>', '[\"uploads\\/about\\/1768116049_69634f51120f4.jpeg\"]', 1, '2025-12-27 03:32:18', '2026-01-11 01:20:49');

