INSERT INTO `messages` (`id`, `name`, `designation`, `photo`, `message`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Syed Obayidul Karim', 'Chairman', 'uploads/messages/1768974768_697069b03d678.png', 'â€œFootball is more than a game. In Bangladesh, it is hope, identity, discipline, and possibility.\r\nAt Ambit10n Academy Bangladesh, our vision is rooted in a simple but powerful belief: talent exists everywhere, but opportunity does not. Our mission is to bridge that gap by building an environment where young players are not only trained to play football at the highest level, but also guided to grow as disciplined, confident, and responsible individuals.&nbsp;<br><br>To our players: this academy exists for you. Your dreams are valid. Your background does not define your ceiling. What will define you is your commitment to learning, to improvement, to teamwork, and to integrity. We promise to give you structure, guidance, and opportunity. In return, we ask for effort, humility, and belief.&nbsp;<br><br>To the families who trust us with what matters most: your children. We understand that football is not just about goals and trophies, it is about education, character, safety, and long-term futures. We are committed to transparent communication, player welfare, and a development pathway that respects both ambition and balance in life.&nbsp;<br><br>To coaches, scouts, and football professionals: Ambit10n Academy aims to be a center of excellence and collaboration. We believe in modern coaching, evidence based development, and shared responsibility for raising standards across Bangladeshi football. Talent identification and development must be fair, ethical, and focused on long term growth rather than short term results.&nbsp;<br><br>And to Bangladesh: our country deserves a football ecosystem that is structured, credible, and globally connected. Ambit10n Academy is our contribution to that future, one built on professionalism, opportunity, and belief in our youth.&nbsp;<br>This is not a short term project. It is a long-term commitment to changing lives through football.&nbsp;<br><br>Together, let us raise the standard.&nbsp;<br>Together, let us build ambition with purpose.â€', 1, '2026-01-20 23:52:48', '2026-01-21 00:08:28'),
(2, 'Sanjay Karim', 'Managing Director', 'uploads/messages/1768976136_69706f0881f67.jpeg', '<p>â€œAt Ambit10n Academy Bangladesh, development is not a slogan, it is a responsibility.<br><br>Our focus is clear: to develop players the right way. That means prioritizing technical excellence, tactical understanding, physical preparation, and mental strength, while never losing sight of education, character, and well-being.<br><br>To our current and future players: you are entering a demanding environment by design. Progress requires discipline, consistency, and resilience. There are no shortcuts here, only structured training, honest feedback, and clear pathways. If you are willing to work, to listen, and to push yourself every day, this academy will invest everything it has in your growth.<br><br>To parents and families: we see you as partners in the journey. Your support, trust, and understanding are essential. Our role is not to promise fame or contracts but to provide a professional development pathway that prepares players for opportunities locally and internationally, whether as footballers or as strong individuals beyond the game.&nbsp;<br><br>To coaches and staff: Ambit10n Academy is built on shared standards and continuous learning. We value modern methodology, accountability, and collaboration. Every session, every decision, and every interaction must serve the long term development of the player.<br><br>To scouts and football institutions: we aim to produce players who are not only talented, but well coached, educated in the game, and ready for higher levels. Our doors remain open for partnerships that align with integrity, transparency, and genuine player development.<br>Bangladesh has the potential to be a respected football nation. Unlocking that potential requires patience, structure, and courage to do things differently. At Ambit10n Academy, we are committed to being part of that change day by day, player by player.<br>The journey will be challenging. But meaningful progress always is.â€</p>', 1, '2026-01-21 00:15:36', '2026-01-21 00:15:36');

